  [],\n\t\"title\": \"NOAA ESRI Grid - NOAA ESRI GRID - 3 m Backscatter Mosaic of
  Mona Island, Puerto Rico, Project NF-08-04, UTM 19N NAD83\",\n\t\"tracking_summary\":
